import React from "react";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import { Button, CardActionArea, CardActions } from "@mui/material";
import background from "./2.jpg";
import { useLocation } from "react-router";

export default function ServiceUser() {
  const location = useLocation();
  const temp = JSON.parse(localStorage.getItem(location.state.service));
  const temp2 = temp[temp.length - 1];

  return (
    <div
      style={{
        backgroundImage: `url(${background})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "100% 100%",
        height: "100vh",
        width: "100%",
        textAlign: "center",
      }}
    >
      {" "}
      <Card sx={{ maxWidth: 445, minHeight: 400, paddingTop: 5 }}>
        <CardActionArea>
          <CardContent>
            <Typography gutterBottom variant="h4" component="div">
              Name : {temp2.name}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              Mobile : {temp2.mobile} <br />
              Price : {temp2.price} <br />
              Service : {location.state.service}
            </Typography>
          </CardContent>
        </CardActionArea>
        <CardActions>
          <Button size="small" style={{ marginLeft: 160 }} color="primary">
            Edit Details
          </Button>
        </CardActions>
      </Card>
    </div>
  );
}
